import React from 'react'
import { Col, Container, Row } from 'react-bootstrap'
import { Link } from 'react-router-dom';
const Shop = () => {
  return (
   <>
    <Container>
     <Row>
       <Col md={3}>
         <div className="logo">
           <Link to="/"><img src="https://img.freepik.com/premium-vector/abstract-modern-ecommerce-logo-design-colorful-gradient-shopping-bag-logo-template_467913-995.jpg" alt="" /></Link>
         </div>
       </Col>
     </Row>
    </Container>
   </>
  )
}

export default Shop;
